const { red } = require("@material-ui/core/colors");

import React, { Component } from 'react'


const btnStyle = {
    color: '#fff',
}

export class SavedEvent extends Component {
    render() {
        return (
            <GridListTile key={this.props.savedEvent.name} cols={1}>
                <img src={this.props.savedEvent.pic} alt="test" />

                <GridListTileBar title="FOOD" subtitle="MUSC" 
                    actionIcon={
                        <div>
                        <Button color='secondary' style={btnStyle}>More Info</Button>
                        <Button color='secondary' style={btnStyle}>Add to Saved</Button>
                        </div>
                    } />
                </GridListTile>
        )
    }
}

export default SavedEvent
